description:
Some time after the Mousekewitz&amp;#039;s have settled in America, they find that they are still having problems with the threat of cats. That makes them eager to try another home out in the west, where they are promised that mice and cats live in peace. Unfortunately, the one making this claim is an oily con artist named Cat R. Waul who is intent on his own sinister plan. Unaware of this, the Mousekewitz&amp;#039;s begin their journey west, while their true cat friend, Tiger, follows intent on following his girlfriend gone in the same direction.

